"like_count": 62, "quote_count": 1}, "created_at": "2022-04-06T12:31:39.000Z", "id": "1511683051578929158", "text": "Mehr Geld f\u00fcr alle, die BAF\u00f6G bekommen. Und wieder mehr Menschen, die es beziehen k\u00f6nnen. So kurz und gut k\u00f6nnte die Reform des #BAF\u00f6G beschrieben werden, die unsere \ud83d\udea6 auf den Weg bringt. Heute im Kabinett, als n\u00e4chstes im #Bundestag und bald auf deinem Konto.", "reply_settings": "everyone", "context_annotations": [{"domain": {"id": "88", "name": "Political Body", "description": "A section of a government, like The Supreme Court"}, "entity": {"id": "1099777660912263168", "name": "German Bundestag", "description": "The Bundestag is the German federal parliament."}}], "conversation_id": "1511683051578929158", "entities": {"hashtags": [{"start": 128, "end": 134, "tag": "BAF\u00f6G"}, {"start": 223, "end": 233, "tag": "Bundestag"}]}, "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 67, "reply_count": 0, "like_count": 0, "quote_count": 0}, "created_at": "2022-04-06T10:20:48.000Z", "entities": {"mentions": [{"start": 3, "end": 13, "username": "KatjaMast", "id": "937678874095300609"}], "hashtags": [{"start": 41, "end": 46, "tag": "Merz"}, {"start": 94, "end": 106, "tag": "Impfpflicht"}]}, "id": "1511650122395967497", "text": "RT @KatjaMast: Ich erwarte von Friedrich #Merz, dass er das parteitaktische Verhalten bei der #Impfpflicht einstellt &amp; mind. dann, wenn sei\u2026", "reply_settings": "everyone", "conversation_id": "1511650122395967497", "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "referenced_tweets": [{"type": "retweeted", "id": "1511641514828611590"}], "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 1, "reply_count": 2, "like_count": 12, "quote_count": 0}, "created_at": "2022-04-04T10:47:35.000Z", "id": "1510932086932316164", "text": "31 Jahre nach dem Brandanschlag in #Saarlouis ist der mutma\u00dfliche M\u00f6rder von #SamuelYeboah gefasst. Unertr\u00e4glich sp\u00e4t. Ohne Ermittlungen der #Bundesanwaltschaft w\u00e4r dieser Nazis nie festgenommen worden. Das Vorgehen von Polizei und Justiz im Saarland muss uns jetzt besch\u00e4ftigen.", "reply_settings": "everyone", "conversation_id": "1510932086932316164", "entities": {"hashtags": [{"start": 35, "end": 45, "tag": "Saarlouis"}, {"start": 77, "end": 90, "tag": "SamuelYeboah"}, {"start": 141, "end": 160, "tag": "Bundesanwaltschaft"}]}, "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 2, "reply_count": 0, "like_count": 10, "quote_count": 0}, "created_at": "2022-03-25T10:46:45.000Z", "id": "1507307998657527810", "in_reply_to_user_id": "21618829", "text": "Es reicht uns Frauen nicht, theoretisch gleichberechtigt zu sein, wenn am Ende unser Kontostand geringer und unsere Renten kleiner sind. Deswegen brauchen wir diesen #Haushalt, der Frauen in Deutschland st\u00e4rkt, der H\u00fcrden abbaut und der alle sieht.", "reply_settings": "everyone", "conversation_id": "1507307997420216344", "entities": {"hashtags": [{"start": 166, "end": 175, "tag": "Haushalt"}]}, "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "referenced_tweets": [{"type": "replied_to", "id": "1507307997420216344"}], "geo": {"place_id": "3078869807f9dd36"}, "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 2, "reply_count": 2, "like_count": 22, "quote_count": 0}, "created_at": "2022-03-25T10:46:45.000Z", "id": "1507307997420216344", "text": "Unsere Aufgabe als Parlamentarier*innen ist es, Frauen zu st\u00e4rken und ihnen zu zeigen: Wir sehen euch. Wir sehen eure Leistung und eure Ersch\u00f6pfung, wir greifen euch unter die Arme. #Bundestag", "reply_settings": "everyone", "context_annotations": [{"domain": {"id": "88", "name": "Political Body", "description": "A section of a government, like The Supr