ain": {"id": "88", "name": "Political Body", "description": "A section of a government, like The Supreme Court"}, "entity": {"id": "1099777660912263168", "name": "German Bundestag", "description": "The Bundestag is the German federal parliament."}}], "conversation_id": "1496542992441741321", "entities": {"hashtags": [{"start": 27, "end": 39, "tag": "Mindestlohn"}, {"start": 178, "end": 188, "tag": "Bundestag"}]}, "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 8, "quote_count": 0}, "created_at": "2022-02-23T14:40:59.000Z", "id": "1496495309094064129", "in_reply_to_user_id": "21618829", "text": "Es ist gut, dass wir deutlich reagieren aber weiter auch Dialog anbieten. Und wir m\u00fcssen solidarisch sein mit den Ukrainer*innen. Die St\u00e4rke freier Gesellschaften, die Putin verabscheut, liegt auch darin, f\u00fcr Frieden zu demonstrieren und zu sagen: Ihr seid uns nicht egal! 2/2", "reply_settings": "everyone", "context_annotations": [{"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "864931126132985856", "name": "Vladimir Putin", "description": "President of Russia Vladimir Putin"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "864931126132985856", "name": "Vladimir Putin", "description": "President of Russia Vladimir Putin"}}], "conversation_id": "1496495307240230912", "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "referenced_tweets": [{"type": "replied_to", "id": "1496495307240230912"}], "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 12, "quote_count": 1}, "created_at": "2022-02-23T14:40:59.000Z", "id": "1496495307240230912", "text": "Putin bricht das #V\u00f6lkerrecht und Millionen Ukrainer*innen wissen abends