hen das die Menschen im #Saarland?", "reply_settings": "everyone", "context_annotations": [{"domain": {"id": "88", "name": "Political Body", "description": "A section of a government, like The Supreme Court"}, "entity": {"id": "1099777660912263168", "name": "German Bundestag", "description": "The Bundestag is the German federal parliament."}}], "conversation_id": "1491063288561639428", "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 12, "quote_count": 0}, "created_at": "2022-02-04T11:32:56.000Z", "id": "1489562614199902211", "text": "Die #Schweigeminute heute war ein Gedenken an die get\u00f6teten Polizist*innen Yasmin Bux und Alexander Klos. Sie war Symbol f\u00fcr unsere Mitgef\u00fchl f\u00fcr die Hinterbliebenen. Und sie sollte auch zu einem Zeichen der Wertsch\u00e4tzung f\u00fcr die Arbeit der Polizist*innen in unserem Land werden.", "reply_settings": "everyone", "conversation_id": "1489562614199902211", "entities": {"hashtags": [{"start": 4, "end": 19, "tag": "Schweigeminute"}]}, "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 15, "reply_count": 3, "like_count": 104, "quote_count": 1}, "created_at": "2022-01-31T09:51:18.000Z", "entities": {"mentions": [{"start": 193, "end": 204, "username": "Polizei_KL", "id": "886595382"}, {"start": 209, "end": 225, "username": "PolizeiSaarland", "id": "821727790374469632"}], "urls": [{"start": 259, "end": 282, "url": "https://t.co/H6vKrU6DF0", "expanded_url": "https://twitter.com/Polizei_KL/status/1488041040183537664", "display_url": "twitter.com/Polizei_KL/sta\u2026"}], "hashtags": [{"start": 252, "end": 258, "tag": "Kusel"}]}, "id": "1488087485649498112", "text": "Zwei junge Menschen sind aus dem Leben gerissen - eine 24-j\u00e4hrige Polizistin und ein 29-J\u00e4hriger Polizist. Mein Beileid den Familien, Freund*innen und Kolleg*innen! Ich hoffe, die Fahndung der @Polizei_KL und @PolizeiSaarland sind schnell erfolgreich! #Kusel https://t.co/H6vKrU6DF0", "reply_settings": "everyone", "conversation_id": "1488087485649498112", "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "referenced_tweets": [{"type": "quoted", "id": "1488041040183537664"}], "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 10, "reply_count": 3, "like_count": 68, "quote_count": 1}, "created_at": "2022-01-27T11:09:33.000Z", "id": "1486657625303535618", "text": "Inge Auerbacher erz\u00e4hlt aus ihrer Kindheit, wie Opa und Papa ins KZ kamen, von ihrer Ausgrenzung als j\u00fcdisches Kind. Von ihrer Deportation ins KZ als 7-j\u00e4hriges M\u00e4dchen. Es sind lebendige Erlebnisse aus dem Holocaust. Wir m\u00fcssen diese Erinnerungen wach halten. #WeRemember", "reply_settings": "everyone", "conversation_id": "1486657625303535618", "entities": {"hashtags": [{"start": 261, "end": 272, "tag": "WeRemember"}]}, "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 80, "reply_count": 0, "like_count": 0, "quote_count": 0}, "created_at": "2022-01-25T22:04:41.000Z", "entities": {"mentions": [{"start": 3, "end": 19, "username": "JA_Allmendinger", "id": "1316387758215225347"}, {"start": 121, "end": 135, "username": "Bundesagentur", "id": "761654694"}]}, "id": "1486097720528216068", "text": "RT @JA_Allmendinger: Was lange w\u00e4hrt, wird besonders gut. Ich freue mich riesig, dass Andrea Nahles die erste Chefin der @Bundesagentur wir\u2026", "reply_settings": "everyone", "conversation_id": "1486097720528216068", "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "referenced_tweets": [{"type": "retweeted", "id": "1486002491196063757"}], "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 5, "reply_count": 2, "like_count": 39, "quote_count": 1}, "created_at": "2022-01-