4668550", "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 11, "reply_count": 20, "like_count": 413, "quote_count": 6}, "created_at": "2021-09-26T19:48:28.000Z", "id": "1442214509381185541", "text": "Mission accomplished! Der Wahlkreis bleibt rot! \nIch bin gl\u00fccklich und dankbar \u00fcber das heutige Votum! #wahlkreis296 https://t.co/mwAEbh2bsZ", "reply_settings": "everyone", "conversation_id": "1442214509381185541", "entities": {"urls": [{"start": 117, "end": 140, "url": "https://t.co/mwAEbh2bsZ", "expanded_url": "https://twitter.com/josephineortleb/status/1357332828552388609", "display_url": "twitter.com/josephineortle\u2026"}], "hashtags": [{"start": 103, "end": 116, "tag": "wahlkreis296"}]}, "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "referenced_tweets": [{"type": "quoted", "id": "1357332828552388609"}], "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 19, "quote_count": 1}, "created_at": "2021-08-17T08:43:33.000Z", "id": "1427551660226850826", "in_reply_to_user_id": "21618829", "text": "Wir m\u00fcssen Frauenrechtlerinnen und Mitarbeiterinnen von Frauenrechtsorganisationen sch\u00fctzen. Sie sind aufgrund ihrer Arbeit Zielscheibe der Taliban. Wir d\u00fcrfen nicht weiter Zeit verlieren und m\u00fcssen so viele Menschen wie m\u00f6glich aus der schrecklichen Situation retten! 2/2", "reply_settings": "everyone", "conversation_id": "1427550763425935362", "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "referenced_tweets": [{"type": "replied_to", "id": "1427550763425935362"}], "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 20, "quote_count": 1}, "created_at": "2021-08-17T08:39:59.000Z", "id": "1427550763425935362", "text": "Noch immer erschrecken mich, wie viele von Euch auch, die schrecklichen Bilder, die uns aus #Afghanistan erreichen. Oberste Priorit\u00e4t hat die unb\u00fcrokratische, schnelle Evakuierung von Ortskr\u00e4ften, Botschaftsmitarbeiter*innen u Mitarbeiter*innen von Entwicklungsorganisationen! 1/2", "reply_settings": "everyone", "conversation_id": "1427550763425935362", "entities": {"hashtags": [{"start": 92, "end": 104, "tag": "Afghanistan"}]}, "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 0, "quote_count": 0}, "created_at": "2021-08-16T19:04:43.000Z", "entities": {"mentions": [{"start": 3, "end": 10, "username": "TKinSL", "id": "179028677"}, {"start": 64, "end": 80, "username": "josephineortleb", "id": "21618829"}], "hashtags": [{"start": 128, "end": 134, "tag": "BTW21"}]}, "id": "1427345595094732808", "text": "RT @TKinSL: Ich hatte heute ein sehr interessantes Gespr\u00e4ch mit @josephineortleb. Wir haben uns zur Gesundheitspolitik nach der #BTW21, abe\u2026", "reply_settings": "everyone", "conversation_id": "1427345595094732808", "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "referenced_tweets": [{"type": "retweeted", "id": "1427271023641219074"}], "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 6, "reply_count": 49, "like_count": 737, "quote_count": 0}, "created_at": "2021-08-13T17:13:30.000Z", "id": "1426230444723515400", "text": "Seit ein paar Wochen habe ich einen neuen Begleiter. Einen kleinen Begleiter, der immer da ist und der mich in meiner Vision f\u00fcr ein gerechteres Morgen best\u00e4rkt. Einen kleinen Menschen, auf den ich mich unfassbar freue, den ich in wenigen Monaten endlich kennenlernen darf! https://t.co/dMk0cEwzIZ", "reply_settings": "everyone", "conversation_id": "1426230444723515400", "entities": {"urls": [{"start": 274, "end": 297, "url": "https://t.co/dMk0cEwzIZ", "expanded_url": "https://twitter.com/josephineortleb/status/1426230444723515400/photo/1", "display_url": "pic.twitter.com/dMk0cEwzIZ"}]}, "attachments": {"media_keys": ["3_1426230393120907264"]}, "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 7, "reply_count": 1, "like_count": 50, "quote_count": 0}, "created_at": "2021-08-09T10:33:47.000Z", "entities": {"mentions": [{"start": 250, "end": 262, "username": "Gruene_Saar", "id": "19330610"}, {"start": 263, "end": 277, "username": "therealhabeck", "id": "1082604599662522371"}], "hashtags": [{"start": 145, "end": 157, "tag": "Zahlenspiel"}, {"start": 206, "end": 220, "tag": "Verantwortung"}]}, "id": "1424680298730725376", "text": "Wer als Vorsitzender einer Partei, mit bundesweitem F\u00fchrungsanspruch, die Nicht-W\u00e4hlbarkeit im Saarland lediglich \u201e\u00e4rgerlich\u201c findet und nur als #Zahlenspiel begreift, der versteht nicht, was demokratische #Verantwortung f\u00fcr das ganze Land bedeutet. @Gruene_Saar @therealhabeck", "reply_settings": "everyone", "conversation_id": "1424680298730725376", "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "source": "Twitter Web App"}, {"public_metrics": {"retweet_count": 3, "reply_count": 3, "like_count": 64, "quote_count": 2}, "created_at": "2021-08-04T17:41:27.000Z", "id": "1422975988351258625", "text": "Noch 53 Tage bis zur Bundestagswahl!\n\u27a1\ufe0fBezahlbare Mieten\n\u27a1\ufe0fStabile Renten\n\u27a1\ufe0f12 Euro Mindestlohn \n\u27a1\ufe0fInnovativer Klimaschutz \n#ScholzPacktDasAn", "reply_settings": "everyone", "conversation_id": "1422975988351258625", "entities": {"hashtags": [{"start": 124, "end": 141, "tag": "ScholzPacktDasAn"}]}, "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 4, "quote_count": 0}, "created_at": "2021-07-28T12:46:37.000Z", "entities": {"mentions": [{"start": 0, "end": 14, "username": "larsklingbeil", "id": "16255