_count": 58, "reply_count": 38, "like_count": 1182, "quote_count": 22}, "created_at": "2021-02-04T14:18:59.000Z", "entities": {"mentions": [{"start": 15, "end": 19, "username": "akk", "id": "47620601"}], "urls": [{"start": 95, "end": 118, "url": "https://t.co/oODl0vdso5", "expanded_url": "https://twitter.com/szaktuell/status/1357289455040815107", "display_url": "twitter.com/szaktuell/stat\u2026"}], "hashtags": [{"start": 58, "end": 71, "tag": "wahlkreis296"}, {"start": 73, "end": 94, "tag": "saarbr\u00fcckenbleibtrot"}]}, "id": "1357332828552388609", "text": "Dann zeige ich @akk jetzt mal, wie Verteidigung geht ;-)! #wahlkreis296  #saarbr\u00fcckenbleibtrot https://t.co/oODl0vdso5", "reply_settings": "everyone", "context_annotations": [{"domain": {"id": "88", "name": "Political Body", "description": "A section of a government, like The Supreme Court"}, "entity": {"id": "1099777660912263168", "name": "German Bundestag", "description": "The Bundestag is the German federal parliament."}}], "conversation_id": "1357332828552388609", "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "referenced_tweets": [{"type": "quoted", "id": "1357289455040815107"}], "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 20, "quote_count": 1}, "created_at": "2021-08-17T08:39:59.000Z", "id": "1427550763425935362", "text": "Noch immer erschrecken mich, wie viele von Euch auch, die schrecklichen Bilder, die uns aus #Afghanistan erreichen. Oberste Priorit\u00e4t hat die unb\u00fcrokratische, schnelle Evakuierung von Ortskr\u00e4ften, Botschaftsmitarbeiter*innen u Mitarbeiter*innen von Entwicklungsorganisationen! 1/2", "reply_settings": "everyone", "conversation_id": "1427550763425935362", "entities": {"hashtags": [{"start": 92, "end": 104, "tag": "Afghanistan"}]}, "possibly_sensitive": false, "author_id": "21618829", "lang": "de", "source": "Twitter for iPhone"}, {"public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 11, "quote_count": 0}, "created_at": "2021-08-16T14:08:24.000Z", "entities": {"mentions": [{"start": 52, "end": 68, "username": "josephineortleb", "id": "21618829"}], "urls": [{"start": 236, "end": 259, "url": "https://t.co/XTEYALXDe0", "expanded_url": "https://twitter.com/TKinSL/status/1427271023641219074/photo/1", "display_url": "pic.twitter.com/XTEYALXDe0"}], "hashtags": [{"start": 116, "end": 122, "tag": "BTW21"}, {"start": 160, "end": 167, "tag": "Pflege"}, {"start": 176, "end": 192, "tag": "Digitalisierung"}]}, "id": "1427271023641219074", "text": "Ich hatte heute ein sehr interessantes Gespr\u00e4ch mit @josephineortleb. Wir haben uns zur Gesundheitspolitik nach der #BTW21, aber auch zur aktuellen Lage in der #Pflege und der #Digitalisierung im Saarland ausgetauscht. Vielen Dank! ^SG https://t.co/XTEYALXDe0", "reply_settings": "everyone", "conversation_id": "1427271023641219074", "attachments": {"media_keys": ["3_1427264049729900550"]}, "possibly_sensitive": false, "author_id": "179028677", "lang": "de", "source": "Twitter Web App"}, {"public_metrics": {"retweet_count": 9, "reply_count": 22, "like_count": 370, "quote_count": 1}, "created_at": "2021-07-28T11:54:32.000Z", "entities": {"mentions": [{"start": 28, "end": 42, "username": "AnkeRehlinger", "id": "474792689"}, {"start": 47, "end": 63, "username": "josephineortleb", "id": "21618829"}, {"start": 136, "end": 140, "username": "ZDF", "id": "57350105"}], "urls": [{"start": 144, "end": 167, "url": "https://t.co/bGVvhFhrFg", "expanded_url": "https://twitter.com/BosseSpohn/status/1420332969282125830", "display_url": "twitter.com/BosseSpohn/sta\u2026"}]}, "id": "1420351968380432386", "text": "Also ich war ja neulich bei @AnkeRehlinger und @josephineortleb im Saarland und es war wirklich nett. Aber das hier geht zu weit liebes @zdf :) https://t.co/bGVvhFhrFg", "reply_settings": "everyone", "conversation_id": "1420351968380432386", "possibly_sensitive": false, "author_id": "16255941", "lang": "de", "r