eferenced_tweets": [{"type": "replied_to", "id": "1380570909312946177"}], "created_at": "2021-04-09T17:18:49.000Z", "conversation_id": "1380570905458380803", "author_id": "21618829", "reply_settings": "everyone", "lang": "de", "in_reply_to_user_id": "21618829", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 10, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1380570910642540546", "text": "Viele Sonderwege k\u00f6nnen bei rasant steigenden Infektionszahlen und einer steigenden Belastung der Krankenh\u00e4user nicht die L\u00f6sung sein. Wir brauchen einen gemeinsamen einheitlichen Rahmen, um regionale Entscheidungen bei niedrigen Inzidenzen zu erm\u00f6glichen. (5/5)"}, {"referenced_tweets": [{"type": "replied_to", "id": "1380570908075638791"}], "created_at": "2021-04-09T17:18:49.000Z", "conversation_id": "1380570905458380803", "author_id": "21618829", "reply_settings": "everyone", "lang": "de", "in_reply_to_user_id": "21618829", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 10, "quote_count": 0}, "entities": {"hashtags": [{"start": 181, "end": 192, "tag": "Homeoffice"}]}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1380570909312946177", "text": "Dabei m\u00fcssen wir aber konsequent und klar sein. Dazu geh\u00f6rt vor allem schnelleres Impfen, aber auch verbindliche Testangebote am Arbeitsplatz und an Schulen/Kitas und ein Recht auf #Homeoffice. (4/5)"}, {"referenced_tweets": [{"type": "replied_to", "id": "1380570906829844482"}], "created_at": "2021-04-09T17:18:48.000Z", "conversation_id": "1380570905458380803", "author_id": "21618829", "reply_settings": "everyone", "lang": "de", "in_reply_to_user_id": "21618829", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 6, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1380570908075638791", "text": "Wir alle sind m\u00fcde und brauchen eine Perspektive, um die letzten Meter durchzuhalten. Perspektive geben bedeutet nicht alles (pressewirksam) zu \u00f6ffnen, sondern verbindliche Ma\u00dfnahmen anhand von nachvollziehbaren Zahlen zu definieren, die uns den Weg aufzeigen. (3/5)"}, {"context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1220701888179359745", "name": "COVID-19"}}], "referenced_tweets": [{"type": "replied_to", "id": "1380570905458380803"}], "created_at": "2021-04-09T17:18:48.000Z", "conversation_id": "1380570905458380803", "author_id": "21618829", "reply_settings": "everyone", "lang": "de", "in_reply_to_user_id": "21618829", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 11, "quote_count": 0}, "entities": {"hashtags": [{"start": 37, "end": 43, "tag": "COVID"}, {"start": 233, "end": 243, "tag": "Notbremse"}]}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1380570906829844482", "text": "Es m\u00fcssen wieder mehr Menschen wegen #COVID Erkrankungen im Krankenhaus behandelt werden. Viele von ihnen auf der Intensivstation, einige von ihnen werden diese Krankheit nicht \u00fcberleben. Daher finde ich es richtig, die beschlossene #Notbremse verbindlich festzulegen. (2/5)"}, {"created_at": "2021-04-09T17:18:48.000Z", "conversation_id": "1380570905458380803", "author_id": "21618829", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 1, "reply_count": 3, "like_count": 14, "quote_count": 0}, "entities": {"hashtags": [{"start": 162, "end": 171, "tag": "Saarland"}]}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1380570905458380803", "text": "Bund und L\u00e4nder haben gemeinsam eine strikte Notbremse bei einer Inzidenz von 100 auf einer Ministerpr\u00e4sidentenkonferenz beschlossen. Heute liegt die Inzidenz im #Saarland bei 97,4. (1/5)"}, {"entities": {"mentions": [{"start": 3, "end": 19, "username": "henningtillmann", "id"