"like_count": 0, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1364944024176623616", "text": "RT @spdbt: .@josephineortleb: \"Frauen in F\u00fchrungspositionen sind kein Versehen, sondern Erf\u00fcllung einer gesellschaftlichen Verpflichtung.\"\u2026"}, {"entities": {"mentions": [{"start": 3, "end": 9, "username": "spdbt", "id": "347792540"}, {"start": 108, "end": 122, "username": "hubertus_heil", "id": "15943222"}], "hashtags": [{"start": 15, "end": 23, "tag": "Caritas"}, {"start": 78, "end": 90, "tag": "Altenpflege"}]}, "context_annotations": [{"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "887728147612880896", "name": "Hubertus Heil", "description": "Hubertus Heil"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "887728147612880896", "name": "Hubertus Heil", "description": "Hubertus Heil"}}], "referenced_tweets": [{"type": "retweeted", "id": "1364928292328009731"}], "created_at": "2021-02-25T13:21:31.000Z", "conversation_id": "1364928513976000516", "author_id": "21618829", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 49, "reply_count": 0, "like_count": 0, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1364928513976000516", "text": "RT @spdbt: Die #Caritas verhindert allgemeinverbindliche Tarifvertr\u00e4ge in der #Altenpflege. Arbeitsminister @hubertus_heil wird nun die Pfl\u2026"}, {"created_at": "2021-02-25T10:35:58.000Z", "conversation_id": "1364886851790733312", "author_id": "21618829", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 1, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1364886851790733312", "text": "Au\u00dferdem soll das Bundesgremienbesetzungsgesetz ausgeweitet werden. Zuk\u00fcnftig fallen Gremien bereits ab zwei Mitgliedern des Bundes unter die Regelungen des Gesetzes. Rund 109 Gremien sollen so k\u00fcnftig ad\u00e4quat mit Frauen besetzt werden. 6/6"}, {"created_at": "2021-02-25T10:33:57.000Z", "conversation_id": "1364886344070287361", "author_id": "21618829", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1364886344070287361", "text": "Auch in K\u00f6rperschaften des \u00f6ffentlichen Rechts soll eine Mindestbeteiligung von einer Frau in mehrk\u00f6pfigen Vorst\u00e4nden eingef\u00fchrt werden. Dazu geh\u00f6ren u.a. Krankenkassen, Renten- und Unfallversicherungstr\u00e4ger und die Bundesagentur f\u00fcr Arbeit. 5/6"}, {"created_at": "2021-02-25T10:32:38.000Z", "conversation_id": "1364886012862824450", "author_id": "21618829", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 3, "reply_count": 0, "like_count": 18, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1364886012862824450", "text": "F\u00fcr Unternehmen mit Mehrheitsbeteiligung des Bundes soll eine feste Frauen- bzw. M\u00e4nnerquote von mindestens 30 Prozent in den Aufsichtsr\u00e4ten festgelegt werden. In Vorst\u00e4nden mit mehr als zwei Mitgliedern soll zudem mindestens eine Frau vertreten sein. 4/6"}, {"created_at": "2021-02-25T10:28:16.000Z", "conversation_id": "1364884916035551236", "author_id": "21618829", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 3, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1364884916035551236", "text": "F\u00fcr alle anderen Unternehmen gilt nach der Gesetzesvorlage: Sie m\u00fcssen in Zukunft begr\u00fcnden, warum sie es sich nicht zum Ziel machen, eine Frau in den Vorstand zu berufen. Fehlende Begr\u00fcndungen und Zielgr\u00f6\u00dfenennungen werden sanktioniert. 3/6"}, {"created_at": "2021-02-25T10:27:15.000Z", "conversation_id": "1364884657746178048", "author_id": "21618829", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 3, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1364884657746178048", "text": "In b\u00f6rsennotierten und parit\u00e4tisch mitbestimmten Unternehmen mit mehr als 2.000 Besch\u00e4ftigten m\u00fcssen in Vorst\u00e4nden mit mehr als 3 Mitgliedern mind. 1 Frau und 1 Mann vertreten sein. Derzeit betrifft das etwa 70 Unternehmen, von denen akt. bei 30 keine Frau im Vorstand sitzt. 2/6"}, {"created_at": "2021-02-25T10:25:03.000Z", "conversation_id": "1364884106023219201", "author_id": "21618829", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 4, "quote_count": 0}, "entities": {"hashtags": [{"start": 23, "end": 29, "tag": "F\u00fcPoG"}, {"start": 192, "end": 200, "tag": "ichwill"}, {"start": 201, "end": 213, "tag": "Frauenquote"}]}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1364884106023219201", "text": "Heute erste Lesung des #F\u00fcPoG 2: Was das Gesetz vorsieht und warum wir Gesetze brauchen, um mehr Frauen in Spitzenpositionen zu bringen - ohne Quote gilt weiterhin die informelle M\u00e4nnerquote! #ichwill #Frauenquote 1/6"}, {"entities": {"mentions": [{"start": 3, "end": 13, "username": "KatjaMast", "id": "937678874095300609"}], "hashtags": [{"start": 19, "end": 29, "tag": "Bundestag"}, {"start": 61, "end": 76, "tag": "Vorstandsquote"}]}, "context_annotations": [{"domain": {"id": "88", "name": "Political Body", "description": "A section of a government, like The Supreme Court"}, "entity": {"id": "1099777660912263168", "name": "German Bundestag", "description": "The Bundestag is the German federal parliament."}}], "referenced_tweets": [{"type": "retweeted", "id": "