": 54, "end": 61, "tag": "Corona"}, {"start": 127, "end": 136, "tag": "Saarland"}]}, "possibly_sensitive": false, "source": "Swat.io", "id": "1381877317308407815", "text": "M\u00fcssen die Unternehmen k\u00fcnftig ihre Besch\u00e4ftigten auf #Corona testen? Der Bundesarbeitsminister will das. Die Arbeitskammer im #Saarland auch."}, {"entities": {"mentions": [{"start": 44, "end": 55, "username": "OlafScholz", "id": "38150247"}], "urls": [{"start": 264, "end": 287, "url": "https://t.co/V9iBxiXOVU", "expanded_url": "https://twitter.com/spdbt/status/1381525699740192769/photo/1", "display_url": "pic.twitter.com/V9iBxiXOVU"}]}, "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1220701888179359745", "name": "COVID-19"}}], "created_at": "2021-04-12T08:32:48.000Z", "attachments": {"media_keys": ["3_1381525612947505153"]}, "conversation_id": "1381525699740192769", "author_id": "347792540", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 42, "reply_count": 82, "like_count": 254, "quote_count": 12}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1381525699740192769", "text": "Andere stecken ihre Energie in Machtk\u00e4mpfe, @OlafScholz in die Pandemiebek\u00e4mpfung. Diese kann sich nicht aufs Privatleben beschr\u00e4nken. Unternehmen m\u00fcssen beim Testen in die Pflicht genommen werden! Wir m\u00fcssen die sch\u00fctzen, die nicht im Homeoffice arbeiten k\u00f6nnen. https://t.co/V9iBxiXOVU"}, {"referenced_tweets": [{"type": "replied_to", "id": "1380570908075638791"}], "created_at": "2021-04-09T17:18:49.000Z", "conversation_id": "1380570905458380803", "author_id": "21618829", "reply_settings": "everyone", "lang": "de", "in_reply_to_user_id": "21618829", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 10, "quote_count": 0}, "entities": {"hashtags": [{"start": 181, "end": 192, "tag": "Homeoffice"}]}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1380570909312946177", "text": "Dabei m\u00fcssen wir aber konsequent und klar sein. Dazu geh\u00f6rt vor allem schnelleres Impfen, aber auch verbindliche Testangebote am Arbeitsplatz und an Schulen/Kitas und ein Recht auf #Homeoffice. (4/5)"}, {"referenced_tweets": [{"type": "replied_to", "id": "1380570906829844482"}], "created_at": "2021-04-09T17:18:48.000Z", "conversation_id": "1380570905458380803", "author_id": "21618829", "reply_settings": "everyone", "lang": "de", "in_reply_to_user_id": "21618829", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 6, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1380570908075638791", "text": "Wir alle sind m\u00fcde und brauchen eine Perspektive, um die letzten Meter durchzuhalten. Perspektive geben bedeutet nicht alles (pressewirksam) zu \u00f6ffnen, sondern verbindliche Ma\u00dfnahmen anhand von nachvollziehbaren Zahlen zu definieren, die uns den Weg aufzeigen. (3/5)"}, {"context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1220701888179359745", "name": "COVID-19"}}], "referenced_tweets": [{"type": "replied_to", "id": "1380570905458380803"}], "created_at": "2021-04-09T17:18:48.000Z", "conversation_id": "1380570905458380803", "author_id": "21618829", "reply_settings": "everyone", "lang": "de", "in_reply_to_user_id": "21618829", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 11, "quote_count": 0}, "entities": {"hashtags": [{"start": 37, "end": 43, "tag": "COVID"}, {"start": 233, "end": 243, "tag": "Notbremse"}]}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1380570906829844482", "text": "Es m\u00fcssen wieder mehr Menschen wegen #COVID Erkrankungen im Krankenhaus behandelt werden. Viele von ihnen auf der Intensivstation, einige von ihnen werden diese Krankheit nicht \u00fcberleben. Daher finde ich es richtig, die beschlossene #Notbremse verbindlich festzulegen. (2/5)"}, {"created_at": "2021-04-09T17:18:48.000Z", "conversation_id": "1380570905458380803", "author_id": "21618829", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 1, "reply_count": 3, "like_count": 14, "quote_count": 0}, "entities": {"hashtags": [{"start": 162, "end": 171, "tag": "Saarland"}]}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1380570905458380803", "text": "Bund und L\u00e4nder haben gemeinsam eine strikte Notbremse bei einer Inzidenz von 100 auf einer Ministerpr\u00e4sidentenkonferenz beschlossen. Heute liegt die Inzidenz im #Saarland bei 97,4. (1/5)"}, {"context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1220701888179359745", "name": "COVID-19"}}], "created_at": "2021-04-09T12:05:45.000Z", "attachments": {"media_keys": ["3_1380492119819874307"]}, "conversation_id": "1380492123024281601", "author_id": "22836014", "entities": {"urls": [{"start": 94, "end": 117, "url": "https://t.co/Z7EjUlLuw2", "expanded_url": "https://twitter.com/henningtillmann/status/1380492123024281601/photo/1", "display_url": "pic.twitter.com/Z7EjUlLuw2"}]}, "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 266, "reply_count": 44, "like_count": 2898, "quote_count": 39}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1380492123024281601", "text": "Die Wirtschaft und das Coronavirus k\u00f6nnen sich stets auf Powerminister Altmaier verlassen. \ud83d\udc4d\ud83d\ude80 https://t.co/Z7EjUlLuw2"}, {"context_annotations": [{"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "849236271553691648", "name": "Angela Merkel", "description": "Angela Merkel"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "849236271553691648", "name": "Angela Merkel", "description": "Angela Merkel"}}], "referenced_tweets": [{"type": "quoted", "id": "1380498805410426882"}], "created_at": "2021-04-09T12:46:38.000Z", "conversation_id": "1380502412688035840", "author_id": "16255941", "entities": {"urls": [{"start": 160, "end": 183, "url": "https://t.co/iHjO6g3M6c", "expanded_url": "https://twitter.com/FAZ_Politik/status/1380498805410426882", "display_url": "twitter.com/FAZ_Politik/st\u2026"}]}, "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 64, "reply_count": 174, "like_count": 550, "quote_count": 15}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1380502412688035840", "text": "W\u00e4hrend Laschet und S\u00f6der mit ihrem Machtkampf die Union faktisch lahm legen und alle nur noch nerven, l\u00f6sen andere die Herausforderungen und machen Politik... https://t.co/iHjO6g3M6c"}, {"entities": {"mentions": [{"start": 41, "end": 50, "username": "GrueneBW", "id": "16002482"}, {"start": 257, "end": 268, "username": "OlafScholz", "id": "38150247"}, {"start": 275, "end": 281, "username": "spdde", "id": "26458162"}], "hashtags": [{"start": 24, "end": 36, "tag": "Kretschmann"}]}, "created_at": "2021-04-01T16:47:08.000Z", "conversation_id": "1377663832873652229", "author_id": "937678874095300609", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 23, "reply_count": 34, "like_count": 148, "quote_count": 2}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1377663832873652229", "text": "An die Entscheidung von #Kretschmann und @GrueneBW f\u00fcr die CDU sollte auch jede*r bei der Bundestagswahl im Herbst denken. Mehrheiten jenseits der Union sind m\u00f6glich; man muss sich aber daf\u00fcr entscheiden. Das haben die Gr\u00fcnen verpasst. Deshalb bei der BTW: @OlafScholz &amp; @spdde."}, {"created_at": "2021-04-01T16:04:25.000Z", "conversation_id": "1377653083820470272", "author_id": "16255941", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 235, "reply_count": 392, "like_count": 3335, "quote_count": 76}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1377653083820470272", "text": "Die Gr\u00fcnen haben betont, es geht nur um die Inhalte. Auf dieser Grundlage haben sie sich f\u00fcr eine Koalition mit der CDU entschieden. Aha. Das ist auch ein Signal f\u00fcr die Bundestagswahl. Ich bleibe dabei: Deutschland braucht einen Aufbruch ohne eine m\u00fcde &amp; orientierungslose Union."}, {"entities": {"mentions": [{"start": 6, "end": 19, "username": "jokoundklaas", "id": "961876854197006337"}], "urls": [{"start": 285, "end": 308, "url": "https://t.co/fOLnnc91Rq", "expanded_url": "https://twitter.com/sternde/status/1377340681614630921", "display_url": "twitter.com/sternde/status\u2026"}], "hashtags": [{"start": 39, "end": 64, "tag": "nichtselbstverstaendlich"}]}, "referenced_tweets": [{"type": "quoted", "id": "1377340681614630921"}], "created_at": "2021-03-31T21:56:40.000Z", "conversation_id": "1377379343236669441", "author_id": "38150247", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 189, "reply_count": 848, "like_count": 2287, "quote_count": 301}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1377379343236669441", "text": "Danke @jokoundklaas f\u00fcr diese Sendung! #nichtselbstverstaendlich\nUnd - man kann es nicht oft genug sagen - Danke an alle Pflegerinnen &amp; Pfleger! Ohne sie geht nichts. Antwort auf diese Erkenntnis ist nicht, Beifall zu klatschen. Respekt hei\u00dft: gute L\u00f6hne &amp; Arbeitsbedingungen. https://t.co/fOLnnc91Rq"}, {"entities": {"mentions": [{"start": 19, "end": 35, "username": "hib_Nachrichten", "id": "1290666253628080128"}, {"start": 84, "end": 100, "username": "josephineortleb", "id": "21618829"}, {"start": 101, "end": 107, "username": "spdbt", "id": "347792540"}], "urls": [{"start": 257, "end": 280, "url": "https://t.co/VfvKW1M7gu", "expanded_url": "https://twitter.com/FidAReV/status/1375418649696206851/photo/1", "display_url": "pic.twitter.com/VfvKW1M7gu"}], "hashtags": [{"start": 36, "end": 46, "tag": "Bundestag"}, {"start": 51, "end": 66, "tag": "Bundesstiftung"}, {"start": 67, "end": 82, "tag": "Gleichstellung"}, {"start": 218, "end": 236, "tag": "Zivilgesellschaft"}, {"start": 238, "end": 256, "tag": "BerlinerErkl\u00e4rung"}]}, "context_annotations": [{"domain": {"id": "88", "name": "Political Body", "description": "A section of a government, like The Supreme Court"}, "entity": {"id": "1099777660912263168", "name": "German Bundestag", "description": "The Bundestag is the German federal parliament."}}], "created_at": "2021-03-26T12:05:34.000Z", "attachments": {"media_keys": ["3_1375418646982504448"]}, "conversation_id": "1375418649696206851", "author_id": "872166162980798469", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 22, "quote_count": 1}, "possibly_sensitive": false, "source": "Twitter for Android", "id": "1375418649696206851", "text": "Jetzt 1. Lesung im @hib_Nachrichten #Bundestag zur #Bundesstiftung #Gleichstellung. @josephineortleb @spdbt: Gleichstellungspolitische Erfolge sind immer die Erfolge der Gesellschaft. Dank an die guten Impulse aus der #Zivilgesellschaft! #BerlinerErkl\u00e4rung https://t.co/VfvKW1M7gu"}, {"created_at": "2021-03-22T06:42:41.000Z", "conversation_id": "1373887842053595139", "author_id": "30050484", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 5, "reply_count": 3, "like_count": 76, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter for iPad", "id": "1373887842053595139", "text": "Ein Mensch ist tot. Und das ist einfach nur traurig. Niedertr\u00e4chtige Kommentare zumeist rechter Verschw\u00f6rer hier haben nichts mit einer aufrichtigen kritischen Debatte zu tun und sind einfach widerw\u00e4rtig. RIP Karin Strenz"}, {"entities": {"mentions": [{"start": 264, "end": 270, "username": "spdde", "id": "26458162"}, {"start": 271, "end": 277, "username": "spdbt", "id": "347792540"}], "hashtags": [{"start": 0, "end": 10, "tag": "Rassismus"}]}, "created_at": "2021-03-21T07:20:41.000Z", "conversation_id": "1373535016496594944", "author_id": "937678874095300609", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 14, "reply_count": 21, "like_count": 70, "quote_count": 1}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1373535016496594944", "text": "#Rassismus ist ein Gift, das noch immer omnipr\u00e4sent ist - das erleben viele Menschen in unserem Land Tag f\u00fcr Tag. Gegen jeden Rassismus und Hass, f\u00fcr Solidarit\u00e4t u. Respekt zu k\u00e4mpfen bleibt unsere Aufgabe - das gilt gerade am internationalen Tag gegen Rassismus. @spdde @spdbt"}, {"referenced_tweets": [{"type": "quoted", "id": "1372633951580348422"}], "created_at": "2021-03-18T20:05:55.000Z", "conversation_id": "1372640427992580098", "author_id": "1115940238801743872", "entities": {"urls": [{"start": 25, "end": 48, "url": "https://t.co/qzYOGnioXI", "expanded_url": "https://twitter.com/CDeutschlaender/status/1372633951580348422", "display_url": "twitter.com/CDeutschlaende\u2026"}]}, "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 19, "reply_count": 5, "like_count": 267, "quote_count": 1}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1372640427992580098", "text": "CDU/CSU : stop the count https://t.co/qzYOGnioXI"}, {"context_annotations": [{"domain": {"id": "29", "name": "Events [Entity Service]", "description": "Entity Service related Events domain"}, "entity": {"id": "1240931285633130498", "name": "World Press Freedom Day ", "description": "New entity for World Press Freedom Day all years "}}], "created_at": "2021-03-17T11:25:56.000Z", "conversation_id": "1372147181650608129", "author_id": "24158261", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 46, "reply_count": 270, "like_count": 285, "quote_count": 46}, "entities": {"hashtags": [{"start": 4, "end": 19, "tag": "Pressefreiheit"}]}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1372147181650608129", "text": "Die #Pressefreiheit ist keine Verhandlungsmasse. Das haben wir der russischen Seite heute auch unmissverst\u00e4ndlich mitgeteilt. Unsere Aufgabe und unsere Pflicht ist es, den freiheitlichen Rahmen zu schaffen, damit Journalistinnen und Journalisten ihre Arbeit machen k\u00f6nnen. (1/2)"}, {"entities": {"mentions": [{"start": 76, "end": 82, "username": "spdbt", "id": "347792540"}, {"start": 212, "end": 225, "username": "schneidercar", "id": "96783215"}, {"start": 229, "end": 237, "username": "ardmoma", "id": "2829468550"}], "hashtags": [{"start": 4, "end": 18, "tag": "Maskenskandal"}]}, "created_at": "2021-03-17T04:38:40.000Z", "conversation_id": "1372044691886211076", "author_id": "837764438", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 3, "reply_count": 11, "like_count": 17, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1372044691886211076", "text": "Der #Maskenskandal hat das Vertrauen in die Politik massiv ersch\u00fcttert. Die @spdbt fordert jetzt einen unabh\u00e4ngigen Beauftragten, der ihn untersuchen soll. Wahlkampfman\u00f6ver oder echte Aufkl\u00e4rung? Gleich ist dazu @schneidercar im @ardmoma"}, {"entities": {"mentions": [{"start": 0, "end": 16, "username": "josephineortleb", "id": "21618829"}, {"start": 17, "end": 26, "username": "BMG_Bund", "id": "2478349112"}]}, "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1220701888179359745", "name": "COVID-19"}}], "referenced_tweets": [{"type": "replied_to", "id": "1371733023574593536"}],