count": 0}, "reply_settings": "everyone", "created_at": "2021-02-10T07:07:12.000Z", "text": "F\u00fcr mich ist aber auch klar, dass wir all diejenigen, die gerade von den Schlie\u00dfungen betroffen sind, weiterhin mit aller Kraft unterst\u00fctzen. Deswegen werde ich mich auch in den kommenden Tagen und Wochen weiterhin f\u00fcr zielgenauere Hilfen starkmachen. 2/3", "source": "Twitter Web App", "id": "1359398496722386945", "lang": "de"}, {"author_id": "21618829", "possibly_sensitive": false, "conversation_id": "1359398393332846594", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 26, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2021-02-10T07:06:48.000Z", "text": "Ja, wir sind mittlerweile alle etwas \u201epandemiem\u00fcde\u201c und w\u00fcnschen uns unseren Alltag zur\u00fcck. Umso wichtiger wird es also in den kommenden Wochen sein, dass wir uns weiterhin an die Regeln halten und (auch wenn es schwer ist) weiterhin auf vieles verzichten. 1/3", "source": "Twitter Web App", "id": "1359398393332846594", "lang": "de"}, {"author_id": "21618829", "possibly_sensitive": false, "entities": {"mentions": [{"start": 3, "end": 13, "username": "KatjaMast", "id": "937678874095300609"}], "hashtags": [{"start": 93, "end": 108, "tag": "Desinformation"}]}, "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1220701888179359745", "name": "COVID-19"}}], "conversation_id": "1359114706510876676", "public_metrics": {"retweet_count": 9, "reply_count": 0, "like_count": 0, "quote_count": 0}, "referenced_tweets": [{"type": "retweeted", "id": "1359032114818211840"}], "reply_settings": "everyone", "created_at": "2021-02-09T12:19:31.000Z", "text": "RT @KatjaMast: Was uns auch die Corona-Pandemie, Querdenken und Co erneut zeigen: Wir m\u00fcssen #Desinformation und Verschw\u00f6rungstheorien im I\u2026", "source": "Twitter for iPhone", "id": "135911470651