den, wie das @BMF_Bund.\" 2/2", "source": "Twitter Web App", "in_reply_to_user_id": "347792540", "id": "1348989332447752193", "lang": "de"}, {"author_id": "347792540", "possibly_sensitive": false, "entities": {"mentions": [{"start": 1, "end": 12, "username": "OlafScholz", "id": "38150247"}, {"start": 151, "end": 163, "username": "DennisRohde", "id": "18160122"}, {"start": 189, "end": 203, "username": "peteraltmaier", "id": "378693834"}]}, "conversation_id": "1348989331239800833", "public_metrics": {"retweet_count": 20, "reply_count": 23, "like_count": 57, "quote_count": 3}, "reply_settings": "everyone", "created_at": "2021-01-12T13:44:54.000Z", "text": "\"@OlafScholz hat nicht gez\u00f6gert, um die notwendigen Mittel f\u00fcr die Wirtschaftshilfen an Unternehmen und Selbstst\u00e4ndige zur Verf\u00fcgung zu stellen\", sagt @DennisRohde. Der zust\u00e4ndige Minister @peteraltmaier bekommt die Hilfen aber seit Wochen nicht ausgezahlt. 1/2", "source": "Twitter Web App", "id": "1348989331239800833", "lang": "de"}, {"author_id": "467321087", "possibly_sensitive": false, "conversation_id": "1348983471977463808", "public_metrics": {"retweet_count": 35, "reply_count": 37, "like_count": 88, "quote_count": 7}, "reply_settings": "everyone", "created_at": "2021-01-12T13:21:37.000Z", "text": "Heute hat das Kabinett die Ausweitung der #Kinderkrankentage von 10 auf 20 pro Elternteil pro Kind und von 20 auf 40 Tage f\u00fcr #Alleinerziehende beschlossen. Der Anspruch soll nicht nur bei Krankheit des Kindes gelten, sondern auch wenn #Kitas und #Schulen geschlossen sind. https://t.co/jxqhL2ogoj", "source": "Facelift-Cloud", "attachments": {"media_keys": ["3_1348983467527254017"]}, "entities": {"hashtags": [{"start": 42, "end": 60, "tag": "Kinderkrankentage"}, {"start": 126, "end": 143, "tag": "Alleinerziehende"}, {"start": 236, "end": 242, "tag": "Kitas"}, {"start": 247, "end": 255, "tag": "Schulen"}], "urls": [{"start": 274, "end": 297, "url": "https://t.co/jxqhL2ogoj", "expanded_url": "https://twitter.com/BMFSFJ/status/1348983471977463808/photo/1", "display_url": "pic.twitter.com/jxqhL2ogoj"}]}, "id": "1348983471977463808", "lang": "de"}, {"author_id": "494809842", "possibly_sensitive": false, "entities": {"mentions": [{"start": 39, "end": 53, "username": "peteraltmaier", "id": "378693834"}], "hashtags": [{"start": 138, "end": 156, "tag": "Wirtschaftshilfen"}], "urls": [{"start": 257, "end": 280, "url": "https://t.co/ICxMoIyFqI", "expanded_url": "https://www.welt.de/wirtschaft/article224145128/Softwareprobleme-Auszahlung-der-Novemberhilfen-verzoegert-sich-wegen-einer-Peinlichkeit.html", "display_url": "welt.de/wirtschaft/art\u2026"}]}, "conversation_id": "1348868606617153537", "public_metrics": {"retweet_count": 9, "reply_count": 7, "like_count": 41, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2021-01-12T05:45:11.000Z", "text": "Da stellt man sich doch die Frage, was @peteraltmaier beruflich so macht. Sein Haus, das @BMWi_Bund, ist zust\u00e4ndig f\u00fcr die Abwicklung der #Wirtschaftshilfen und bekommt es nicht auf die Reihe. Bei mir haben sich auch schon Gastronomen aus Kassel beschwert. https://t.co/ICxMoIyFqI", "source": "Twitter for iPhone", "id": "1348868606617153537", "lang": "de"}, {"author_id": "26458162", "possibly_sensitive": false, "conversation_id": "1348621564657463297", "public_metrics": {"retweet_count": 11, "reply_count": 16, "like_count": 81, "quote_count": 1}, "referenced_tweets": [{"type": "quoted", "id": "1348562564880494593"}], "reply_settings": "everyone", "created_at": "2021-01-11T13:23:31.000Z", "text": "12 Euro Mindestlohn sind auch unser erkl\u00e4rtes Ziel. #SozialePolitikf\u00fcrDich https://t.co/GUvtJuOamk", "source": "TweetDeck", "entities": {"hashtags": [{"start": 52, "end": 74, "tag": "SozialePolitikf\u00fcrDich"}], "urls": [{"start": 75, "end": 98, "url": "https://t.co/GUvtJuOamk", "expanded_url": "https://twitter.com/dgb_news/status/1348562564880494593", "display_url": "twitter.com/dgb_n