BFm6AZF", "expanded_url": "https://twitter.com/KorkmazGT/status/1207291068276002817/photo/1", "display_url": "pic.twitter.com/Qp6BFm6AZF"}], "hashtags": [{"start": 20, "end": 43, "tag": "Verkehrssicherheit2030"}], "mentions": [{"start": 65, "end": 71, "username": "spdbt", "id": "347792540"}]}, "text": "Heute geht\u2019s um die #Verkehrssicherheit2030 im Fraktionssaal der @spdbt. https://t.co/Qp6BFm6AZF", "conversation_id": "1207291068276002817", "reply_settings": "everyone", "public_metrics": {"retweet_count": 3, "reply_count": 0, "like_count": 17, "quote_count": 0}, "created_at": "2019-12-18T13:26:35.000Z", "attachments": {"media_keys": ["3_1207291061783158785"]}, "author_id": "3930477322", "id": "1207291068276002817", "lang": "de", "possibly_sensitive": false, "source": "Twitter for iPhone"}, {"text": "Wer Maa\u00dfen bei #Lanz zusieht, den kann es nur sch\u00fctteln, dass dieser Mann 6 Jahre lang der oberste Verfassungsh\u00fcter dieses Landes war. Noch fassungsloser als seine Verschw\u00f6rungstheorien macht nur die Tatsache, dass die Union sich von diesem Mann noch immer nicht distanziert hat.", "conversation_id": "1207064720185933824", "entities": {"hashtags": [{"start": 15, "end": 20, "tag": "Lanz"}]}, "reply_settings": "everyone", "public_metrics": {"retweet_count": 146, "reply_count": 72, "like_count": 1135, "quote_count": 9}, "created_at": "2019-12-17T22:27:10.000Z", "author_id": "454981027", "id": "1207064720185933824", "lang": "de", "possibly_sensitive": false, "source": "Twitter Web App"}, {"entities": {"urls": [{"start": 181, "end": 204, "url": "https://t.co/xjO1zwsaHM", "expanded_url": "https://www.zdf.de/nachrichten/zdf-morgenmagazin/moma-duell-wahlrecht-unter-18-100.html", "display_url": "zdf.de/nachrichten/zd\u2026"}], "hashtags": [{"start": 161, "end": 171, "tag": "momaDuell"}, {"start": 172, "end": 180, "tag": "ZDFmoma"}]}, "text": "\"Argumente gegen ein Minderj\u00e4hrigenwahlrecht sind vor allem juristischer Natur\", so Philipp Amthor, CDU. F\u00fcr Josephine Ortleb, SPD, ein vorgeschobenes Argument. #momaDuell #ZDFmoma\nhttps://t.co/xjO1zwsaHM", "conversation_id": "1206856479606804480", "reply_settings": "everyone", "public_metrics": {"retweet_count": 0, "reply_count": 5, "like_count": 5, "quote_count": 1}, "created_at": "2019-12-17T08:39:41.000Z", "author_id": "21780934", "id": "1206856479606804480", "lang": "de", "possibly_sensitive": false, "source": "Twitter Web App"}, {"text": "Dass es eine #Doppelverbeitragung von #Betriebsrenten gab, war ein Fehler. Wir haben den heute ein richtig gutes St\u00fcck wett gemacht, durch einen echten Freibetrag. 60 Prozent zahlen ab 1.1. max den halben KV-Beitrag. Volumen: \u00fcber eine Milliarde Euro. Ich freue mich!", "conversation_id": "1205178151468511233", "entities": {"hashtags": [{"start": 13, "end": 33, "tag": "Doppelverbeitragung"}, {"start": 38, "end": 53, "tag": "Betriebsrenten"}]}, "reply_settings": "everyone", "public_metrics": {"retweet_count": 6, "reply_count": 5, "like_count": 38, "quote_count": 2}, "created_at": "2019-12-12T17:30:37.000Z", "author_id": "516783036", "id": "1205178151468511233", "lang": "de", "possibly_sensitive": false, "source": "Twitter for iPhone"}, {"entities": {"urls": [{"start": 238, "end": 261, "url": "https://t.co/5eS9iWawkQ", "expanded_url": "https://twitter.com/JSUDeutschland/status/1205059637856342017/photo/1", "display_url": "pic.twitter.com/5eS9iWawkQ"}], "hashtags": [{"start": 221, "end": 236, "tag": "Antisemitismus"}], "mentions": [{"start": 8, "end": 14, "username": "spdbt", "id": "347792540"}, {"start": 21, "end": 36, "username": "Timon_Gremmels", "id": "494809842"}, {"start": 38, "end": 47, "username": "jschraps", "id": "1356753444"}, {"start": 49, "end": 60, "username": "helgelindh", "id": "454981027"}, {"start": 62, "end": 78, "username": "IsabelMackensen", "id": "2322165327"}, {"start": 80, "end": 93, "username": "wiebkeesdar1", "id": "1042109887604563968"}, {"start": 95, "end": 106, "username": "SiemtjeMdB", "id": "1115940238801743872"}, {"start": 111, "end": 120, "username": "JOloulou", "id": "1367387016430821377"}]}, "text": "Mit den @spdbt-MdB\u2018s @Timon_Gremmels, @jschraps, @helgelindh, @IsabelMackensen, @wiebkeesdar1, @SiemtjeMdB und @joloulou sprachen wir \u00fcber die regionale Arbeit der JSUD im Bezug auf das j\u00fcdische Leben und den Kampf gegen #Antisemitismus! https://t.co/5eS9iWawkQ", "conversation_id": "1205059637856342017", "reply_settings": "everyone", "public_metrics": {"retweet_count": 5, "reply_count": 0, "like_count": 12, "quote_count": 0}, "created_at": "2019-12-12T09:39:41.000Z", "attachments": {"media_keys": ["3_1205059626003247105"]}, "author_id": "842110534493315072", "id": "1205059637856342017", "lang": "de", "possibly_sensitive": false, "source": "Twitter for iPhone"}, {"entities": {"urls": [{"start": 178, "end": 201, "url": "https://t.co/CX8DnsXI4f", "expanded_url": "https://twitter.com/Elke_Ferner/status/1202907238660218881/photo/1", "display_url": "pic.twitter.com/CX8DnsXI4f"}, {"start": 178, "end": 201, "url": "https://t.co/CX8DnsXI4f", "expanded_url": "https://twitter.com/Elke_Ferner/status/1202907238660218881/photo/1", "display_url": "pic.twitter.com/CX8DnsXI4f"}], "hashtags": [{"start": 37, "end": 50, "tag": "Doppelspitze"}, {"start": 167, "end": 177, "tag": "UnsereSPD"}], "mentions": [{"start": 5, "end": 11, "username": "spdde", "id": "26458162"}, {"start": 75, "end": 89, "username": "ASF_SPDFrauen", "id": "743546822128443392"}]}, "text": "Die  @spdde ist jetzt bereit f\u00fcr die #Doppelspitze. Vor 4 Jahren wurde der @ASF_SPDFrauen Antrag noch nicht mal diskutiert. Danke allen, die das m\u00f6glich gemacht haben #UnsereSPD https://t.co/CX8DnsXI4f", "conversation_id": "1202907238660218881", "reply_settings": "everyone", "public_metrics": {"retweet_count": 9, "reply_count": 3, "like_count": 89, "quote_count": 3}, "created_at": "2019-12-06T11:06:49.000Z", "attachments": {"media_keys": ["3_1202907212403945474", "3_1202907212219375616"]}, 