en, wenn diese f\u00fcr Sicherheit im Verkehr werben. Gut gesagt, @joloulou! \ud83d\udcaa", "conversation_id": "1200070618764451840", "reply_settings": "everyone", "entities": {"mentions": [{"start": 83, "end": 92, "username": "BMI_Bund", "id": "588242800"}, {"start": 244, "end": 253, "username": "JOloulou", "id": "1367387016430821377"}]}, "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 5, "quote_count": 0}, "created_at": "2019-11-28T15:15:06.000Z", "author_id": "347792540", "id": "1200070618764451840", "lang": "de", "possibly_sensitive": false, "source": "Twitter Web App"}, {"entities": {"urls": [{"start": 195, "end": 218, "url": "https://t.co/FhZ0TTUMtF", "expanded_url": "http://hilfetelefon.de", "display_url": "hilfetelefon.de"}, {"start": 277, "end": 300, "url": "https://t.co/G1wz26IZHU", "expanded_url": "https://twitter.com/ThomasHitschler/status/1195271347989090304/photo/1", "display_url": "pic.twitter.com/G1wz26IZHU"}], "hashtags": [{"start": 65, "end": 82, "tag": "schweigenbrechen"}]}, "text": "Mit dem Hilfetelefon \u201eGewalt gegen Frauen\u201c k\u00f6nnen Betroffene ihr #schweigenbrechen. An 365 Tagen, rund um die Uhr, anonym, mehrsprachig und barrierefrei. Telefonisch unter 08000 116 016 oder auf https://t.co/FhZ0TTUMtF. Lasst uns dieses wichtige Angebot noch bekannter machen. https://t.co/G1wz26IZHU", "conversation_id": "1195271347989090304", "reply_settings": "everyone", "public_metrics": {"retweet_count": 5, "reply_count": 0, "like_count": 19, "quote_count": 1}, "created_at": "2019-11-15T09:24:31.000Z", "attachments": {"media_keys": ["3_1195271338283458560"]}, "author_id": "292151515", "id": "1195271347989090304", "lang": "de", "possibly_sensitive": false, "source": "Twitter for iPhone"}, {"entities": {"urls": [{"start": 230, "end": 253, "url": "https://t.co/HOXbzOoLuM", "expanded_url": "https://twitter.com/KatjaMast/status/1195255181149122560/photo/1", "display_url": "pic.twitter.com/HOXbzOoLuM"}], "hashtags": [{"start": 119, "